/**
 * SECTION:OTDObject
 * @title: OTDObject
 * @short_description: Specialized GDBusObject types
 *
 * This section contains the #OTDObject, #OTDObjectProxy, and #OTDObjectSkeleton types which make it easier to work with objects implementing generated types for D-Bus interfaces.
 */

/**
 * OTDObject:
 *
 * The #OTDObject type is a specialized container of interfaces.
 */

/**
 * OTDObjectIface:
 * @parent_iface: The parent interface.
 *
 * Virtual table for the #OTDObject interface.
 */

static void
otd_object_default_init (OTDObjectIface *iface)
{
  /**
   * OTDObject:ostree:
   *
   * The #OTDOSTree instance corresponding to the D-Bus interface <link linkend="gdbus-interface-org-gnome-OSTree.top_of_page">org.gnome.OSTree</link>, if any.
   *
   * Connect to the #GObject::notify signal to get informed of property changes.
   */
  g_object_interface_install_property (iface, g_param_spec_object ("ostree", "ostree", "ostree", OTD_TYPE_OSTREE, G_PARAM_READWRITE|G_PARAM_STATIC_STRINGS));

}

typedef OTDObjectIface OTDObjectInterface;
G_DEFINE_INTERFACE_WITH_CODE (OTDObject, otd_object, G_TYPE_OBJECT, g_type_interface_add_prerequisite (g_define_type_id, G_TYPE_DBUS_OBJECT));

/**
 * otd_object_get_ostree:
 * @object: A #OTDObject.
 *
 * Gets the #OTDOSTree instance for the D-Bus interface <link linkend="gdbus-interface-org-gnome-OSTree.top_of_page">org.gnome.OSTree</link> on @object, if any.
 *
 * Returns: (transfer full): A #OTDOSTree that must be freed with g_object_unref() or %NULL if @object does not implement the interface.
 */
OTDOSTree *otd_object_get_ostree (OTDObject *object)
{
  GDBusInterface *ret;
  ret = g_dbus_object_get_interface (G_DBUS_OBJECT (object), "org.gnome.OSTree");
  if (ret == NULL)
    return NULL;
  return OTD_OSTREE (ret);
}


/**
 * otd_object_peek_ostree: (skip)
 * @object: A #OTDObject.
 *
 * Like otd_object_get_ostree() but doesn't increase the reference count on the returned object.
 *
 * <warning>It is not safe to use the returned object if you are on another thread than the one where the #GDBusObjectManagerClient or #GDBusObjectManagerServer for @object is running.</warning>
 *
 * Returns: (transfer none): A #OTDOSTree or %NULL if @object does not implement the interface. Do not free the returned object, it is owned by @object.
 */
OTDOSTree *otd_object_peek_ostree (OTDObject *object)
{
  GDBusInterface *ret;
  ret = g_dbus_object_get_interface (G_DBUS_OBJECT (object), "org.gnome.OSTree");
  if (ret == NULL)
    return NULL;
  g_object_unref (ret);
  return OTD_OSTREE (ret);
}


static void
otd_object_notify (GDBusObject *object, GDBusInterface *interface)
{
  g_object_notify (G_OBJECT (object), ((_ExtendedGDBusInterfaceInfo *) g_dbus_interface_get_info (interface))->hyphen_name);
}

